import React from "react";
import styled from "styled-components";

const ItemCard = styled.div`
  display: flex;
  position: relative;
  align-content: center;
  width: calc(33% - 4rem);
  margin-right: 2rem;
  margin-bottom: 2rem;
  padding: 1rem;
  border: 1px solid red;
    :nth-of-type(3n){
      margin-right: 0px;
      background: blue;
    }
`;

const ItemType = styled.div`
  display: block;
  position: absolute;
  top: 0px;
`;

const Item = props => {
  console.log(props);
  return (
    <ItemCard>
      <ItemType>{props.type}</ItemType>
      <h1>{props.title}</h1>
      <p>{props.note}</p>
    </ItemCard>
  );
};

export default Item;
